import React from "react";

export default function Note_Report() {
    return (
        <section className="Note_Report_Plate">
            <input
                type="text"
                className="Note_Report_Plate_Title"
                placeholder="Title"
            />
            <textarea
                className="Note_Report_Plate_Text"
                placeholder="text"
            ></textarea>
            <input type="button" />
        </section>
    );
}
